import { View, Text, StyleSheet, FlatList } from 'react-native';


const LoginScreen1 = () => {
    return (
        <View style={styles.mainContainer}>
            <View>
                <Text> LoginScreen1 </Text>
            </View>
        </View>
    )
}
export default LoginScreen1;

const styles = StyleSheet.create({
    mainContainer: {
        backgroundColor: 'yellow',
        flex: 1,

    },
});
